jQuery(function() {
    darkMode();
    readyHomeSlider();
    toggleGraphSize();
    settingsDropdown();
    infoOverlay();
    initPageLoad();
    subnavToggle();
    setGraphToNormalSize();
    toggleSideBar();
    mapInfoOverlay();
    initScrollBar();
});

// Active class to nav link of current page
$(function(){
    var current = location.pathname;
    $('nav ul li a').each(function(){
        var $this = $(this);
        if(current !== "/" && $this.attr('href').indexOf(current) !== -1){
            $this.addClass('active');
        }
    })
})

// Checks if dark mode selection active on page load
$(function() {
    if (Cookies.get('mode') === 'dark') {
        $(document.body).addClass('darkModeActive');
    } 
    // else {
    //     $(document.body).removeClass('darkModeActive');
    // }
});

// Toggle dark mode class
function darkMode() {
    $(".darkModeOption").click(function(e) {
        e.stopPropagation();
        e.preventDefault();
        if ($(document.body).hasClass('darkModeActive')) {
            $(document.body).removeClass('darkModeActive');
            Cookies.remove('mode'); // Removes "dark mode" cookie.
        } else {
            $(document.body).addClass('darkModeActive');
            // Create a cookie that expires 7 days from now, valid across the entire site:
            Cookies.set('mode', 'dark', {
                expires: 7
            });
        }
        $(document.body).toggleClass('settingsActive');
    });
}

// Initialize custom scrollbar 
function initScrollBar() {
    // If scrolldiv present on page
    if ($('.scrolldiv').length > 0) {
        var el = document.querySelector('.scrolldiv');
        SimpleScrollbar.initEl(el);
    }
}

// Initialize home page slider
function readyHomeSlider() {
    $(".homeSlider").slick({
        dots: true,
        infinite: true,
        slidesToShow: 1,
        //autoplay: true,
        autoplaySpeed: 7000
    });
}

function destroyHomeSlider() {
  if ($(".homeSlider").hasClass('slick-initialized')) {
    $(".homeSlider").slick('destroy');
  }      
}

function initPageLoad() {
    new WOW().init();
}

function subnavToggle() {
    var subnavToggle = $(".subnavToggle");
    subnavToggle.click(function() {
        $(this).toggleClass("active");
    });
}

var svg = $("#graphSVG");
var canvasWrapper = $("#3d-graph>div>div>div");
var canvas = $("#3d-graph canvas");
var body = $(document.body);


function setGraphToFullWidth() {
    var w = $(window).width();
    var h = $(window).height();
    svg.attr("width", w - 40);
    svg.attr("height", h - 40);
}

function setGraphToNormalSize() {
    var cW = $(".contentMain").width();
    svg.attr("width", cW);
    svg.attr("height", 720);
}

function toggleGraphSize() {
    var gW = $(".contentMain.graph");
    $(".fullScreenToggler").click(function() {
        if (gW.hasClass('fullActive')) {
            gW.removeClass('fullActive');
            setGraphToNormalSize();
        } else {
            gW.addClass('fullActive');
            setGraphToFullWidth();
        }
    });
}

function toggleSideBar() {
    $("#sideBarTrigger").click(function() {
        $(document.body).toggleClass('sideBarHidden');
    });
}

// Display settings dropdown
function settingsDropdown() {
    $(".settingsToggler").click(function() {
        $(document.body).toggleClass('settingsActive');
    });
}

// Graph Info Overlay
function infoOverlay() {
    $(".infoTrigger").click(function() {
        $(".contentMain.graph").toggleClass('infoActive');
    });
}

// Map Info Overlay
function mapInfoOverlay() {
    $(".mapInfoTrigger").click(function() {
        $(".mapWrapper table").toggleClass('show');
    });
}


